import React, { useEffect, useState } from "react";
import logo from "./logo.svg";
import "./App.css";
import axios from "axios";
import { INews, IArticles } from "./types/news";
import { isTemplateTail } from "typescript";
import Navbar from "./components/Navbar";

function App() {
  const [news, setNews] = useState<INews>();
  useEffect(() => {
    const fetchData = async () => {
      const data = await axios.get("https://newsapi.org/v2/top-headlines?country=id&apiKey=6ea25a8dca434dd38d9adfef34ecfa02");
      setNews(data.data);
    };
    fetchData();
  }, []);
  console.log(news);
  return (
    <>
      <Navbar />
      <div className="App">{news && news.articles.map((article: IArticles) => <h2>{article.author}</h2>)}</div>;
    </>
  );
}

export default App;
